"207333":{"id":"207333","name":"Cem Anos de Solidão","slug":"cem-anos-de-solidao","original_title":"Cien años de soledad","overview":"Na pacata cidade de Macondo, sete gerações da família Buendía vivem o amor, o esquecimento e a impossibilidade de fugir do passado e do próprio destino.","first_air_date":"2024-12-11","episode_run_time":0,"vote_average":8.02,"number_of_seasons":1,"number_of_episodes":8,"created_by":["Alex Garcia Lopez","Laura Mora"],"production_companies":["Dynamo"],"genres":["Drama","Sci-Fi & Fantasy"],"certification":"16","backdrop_path":"https://image.tmdb.org/t/p/original/kTz1SMehYwydblnASFZLjbIOt5T.jpg","poster_path":"https://image.tmdb.org/t/p/original/7wzqSXKqa7CVnyVz8dSHrVeRf16.jpg","cast":["Claudio Cataño","Gino Montesinos","Ruggero Pasquarelli","Marco Antonio González","Susana Morales"],"trailer":"N/A","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/sG1yGRqukcuNlbjr3Uo1CyxZw1K.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/sG1yGRqukcuNlbjr3Uo1CyxZw1K.jpg","air_date":"2024-12-11","episode_count":8,"overview":"N/A","vote_average":8.2,"episodes":{"1":{"name":"Macondo","overview":"Com medo de fantasmas e de uma maldição, Úrsula e José Arcadio deixam a terra natal, desbravando caminhos difíceis com um grupo cheio de coragem para fundar um novo lar.","air_date":"2024-12-11","runtime":64,"still_path":"https://image.tmdb.org/t/p/original/9GNp1qDvSkxVn1ejgPyLsWyxU5Q.jpg","vote_average":8},"2":{"name":"É como um terremoto","overview":"Aureliano tem visões de guerra e José Arcadio Jr. conhece uma mulher. A obsessão de José Arcadio com a alquimia leva Úrsula a achar um jeito de sustentar a família.","air_date":"2024-12-11","runtime":59,"still_path":"https://image.tmdb.org/t/p/original/vizdx41QJay475Tvcrjony050BM.jpg","vote_average":8.833},"3":{"name":"Um daguerreótipo de Deus","overview":"Uma garota estranha leva uma doença misteriosa a Macondo. José Arcadio fica fascinado com a câmera de Melquíades. Rebeca e Amaranta disputam o coração de Pietro.","air_date":"2024-12-11","runtime":68,"still_path":"https://image.tmdb.org/t/p/original/xr1x0JvdpaYi8HARSBFtGznKEWN.jpg","vote_average":7.833},"4":{"name":"O castanheiro","overview":"Um novo prefeito e sua família chegam a Macondo. Aureliano descobre o amor. Uma tragédia leva José Arcadio à loucura.","air_date":"2024-12-11","runtime":66,"still_path":"https://image.tmdb.org/t/p/original/94qArX0KxcKaU0j5XgSncvL2UoO.jpg","vote_average":8},"5":{"name":"Remedios Moscote","overview":"Arcadio se torna diretor da escola. Pilar traz notícias importantes para Aureliano. Remedios enche a casa dos Buendía de alegria. Até que a tragédia acontece.","air_date":"2024-12-11","runtime":62,"still_path":"https://image.tmdb.org/t/p/original/lvdPr8tGZ33fWKzXy4VQqECsNj3.jpg","vote_average":8.5},"6":{"name":"Coronel Aureliano Buendía","overview":"José Arcadio Jr. retorna e deixa todos chocados com sua rebeldia, principalmente Rebeca. Em meio à agitação política, Aureliano se torna um líder revolucionário.","air_date":"2024-12-11","runtime":63,"still_path":"https://image.tmdb.org/t/p/original/cH6XtbYEeDC8xevQhV6pSX7kP9K.jpg","vote_average":8},"7":{"name":"Arcadio e o paraíso liberal","overview":"Arcadio impõe um governo liberal em Macondo. Aureliano tenta libertar um coronel das mãos de conservadores. A ameaça de guerra, que parecia distante, finalmente chega.","air_date":"2024-12-11","runtime":65,"still_path":"https://image.tmdb.org/t/p/original/nDv2jtduI4fz9XWjnJlaHzLLoio.jpg","vote_average":8},"8":{"name":"Tantas flores caíram do céu","overview":"Anos depois, quando Aureliano revela seus planos de guerra para Macondo, Úrsula, arrasada, faz uma descoberta surpreendente sobre sua família.","air_date":"2024-12-11","runtime":64,"still_path":"https://image.tmdb.org/t/p/original/adzLSgzmxT1HN3oi5XfFgLPqlG0.jpg","vote_average":8.75}}}}},
