"137043":{"id":"137043","name":"Interligados","slug":"interligados","original_title":"커넥트","overview":"Dongsoo leva uma vida solitária, passando seu tempo postando músicas na internet. Sua vida pacata é interrompida quando ele é sequestrado por um caçador de órgãos, que remove um de seus olhos. Pouco tempo depois, Dongsoo percebe que está compartilhando a mesma visão com a pessoa que recebeu seu olho. Através desta conexão, ele percebe que quem recebeu seu olho é um serial killer, e começa a ir atrás deste assassino para pegar seu olho de volta.","first_air_date":"2022-12-07","episode_run_time":46,"vote_average":7.6,"number_of_seasons":1,"number_of_episodes":6,"created_by":["Takashi Miike"],"production_companies":["Studio Dragon","Studio HIM","LEE'z Film"],"genres":["Mistério","Drama","Crime","Sci-Fi & Fantasy"],"certification":"16","backdrop_path":"https://image.tmdb.org/t/p/original/qmOMfbBANh1ec5mqk4hkPWtVVLY.jpg","poster_path":"https://image.tmdb.org/t/p/original/4pGy7QC1vEgALDVv2L1HNIEgd1N.jpg","cast":["Jung Hae-in","고경표","김혜준","김뢰하","양동근"],"trailer":"6bVixKByhfo","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/4pGy7QC1vEgALDVv2L1HNIEgd1N.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/4pGy7QC1vEgALDVv2L1HNIEgd1N.jpg","air_date":"2022-12-07","episode_count":6,"overview":"N/A","vote_average":8.2,"episodes":{"1":{"name":"Conexão","overview":"Dongsoo é sequestrado e tem um olho removido por um caçador de órgãos. Dongsoo consegue fugir. Enquanto isso, o artista cadavérico está a solta. Dongsoo descobre que ele consegue se conectar à visão da pessoa que recebeu seu olho transplantado, mas a pessoa que recebeu o olho é um serial killer.","air_date":"2022-12-07","runtime":47,"still_path":"https://image.tmdb.org/t/p/original/7pMZ6G2ncvg8O9sLAZ0RtRsZEuh.jpg","vote_average":5},"2":{"name":"Conjunção","overview":"Dongsoo traça o paradeiro do assassino que recebeu o seu olho graças a visão conectada. Com o caçador de órgãos atrás dele, será que Dongsoo conseguirá achar o assassino e recuperar seu olho a tempo?","air_date":"2022-12-07","runtime":43,"still_path":"https://image.tmdb.org/t/p/original/kaz02qu5Ju08NF8lMf8BaVUdtue.jpg","vote_average":9},"3":{"name":"Composição","overview":"O assassino ataca novamente. Enquanto tenta pegá-lo, Dongsoo acaba se tornando suspeito de assassinato. Com ajuda para sair dessa enrascada, ele enfrenta a realidade nua e crua de “Connect”. Jinseop, o artista cadavérico, agora está ciente da existência de Dongsoo.","air_date":"2022-12-07","runtime":43,"still_path":"https://image.tmdb.org/t/p/original/xVQB6h9Z4pRmMwuZklq8DdoURPD.jpg","vote_average":9},"4":{"name":"Confissão","overview":"Dongsoo conta seu segredo para o Inspetor Choi. Jinseop sequestra o médico que fez a cirurgia de transplante e arranca uma confissão dele. Irang, uma aspirante a escritora, conta a verdade para Dongsoo. Jinseop arma uma emboscada para pegar Dongsoo, que dribla seus planos.","air_date":"2022-12-07","runtime":45,"still_path":"https://image.tmdb.org/t/p/original/x1pYCnYHU4ym8imcyaj2jCx2BBL.jpg","vote_average":8},"5":{"name":"Confecção","overview":"Jinseop sequestra Z para atrair Dongsoo. Para piorar a situação, o dono do lixão também está em perigo. As chances de sucesso diminuem para Dongsoo enquanto ele tenta resgatar ambos de Jinseop.","air_date":"2022-12-07","runtime":37,"still_path":"https://image.tmdb.org/t/p/original/m7QFmiXQhBW4lEel1xVR06mUk9S.jpg","vote_average":9},"6":{"name":"Confusão","overview":"Dongsoo é mantido refém por Jinseop em seu ateliê. Irang e o Inspetor Choi armam uma invasão no ateliê, mas seus interesses divergentes acabam causando uma situação caótica.","air_date":"2022-12-07","runtime":42,"still_path":"https://image.tmdb.org/t/p/original/hKl9tsYkJm2fSNo1ecHz5HQaoq7.jpg","vote_average":9}}}}},
