"78385":{"id":"78385","name":"Something in the Rain","slug":"something-in-the-rain","original_title":"밥 잘 사주는 예쁜 누나","overview":"Explore o relacionamento de duas pessoas à medida que passam de “apenas conhecidos” para “um casal genuíno” – Yoon Jin Ah, uma supervisora ​​de café na casa dos 30 anos, e Seo Joon Hee, designer de uma empresa de videogame que acabou de retornar de trabalhar no exterior.","first_air_date":"2018-03-30","episode_run_time":75,"vote_average":7.7,"number_of_seasons":1,"number_of_episodes":16,"created_by":["Kim Eun"],"production_companies":["SLL","DramaHouse","Content K"],"genres":["Drama"],"certification":"12","backdrop_path":"https://image.tmdb.org/t/p/original/vS5A1aSR00eEjkBpLFJ6XpfT0Ak.jpg","poster_path":"https://image.tmdb.org/t/p/original/dUvYD6gPUqND7av4A0bXv69cLs6.jpg","cast":["손예진","Jung Hae-in","장소연","정유진","주민경"],"trailer":"N/A","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/pBeohF47FEtP4sHgODMPHKSqyny.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/pBeohF47FEtP4sHgODMPHKSqyny.jpg","air_date":"2018-03-30","episode_count":16,"overview":"Uma mulher reencontra o irmão da melhor amiga, que acaba de voltar de uma temporada no exterior, e passa a enxergá-lo com um novo olhar.","vote_average":10,"episodes":{"1":{"name":"Episódio 1","overview":"Com romances desfeitos e estresse no trabalho, a vida aos 35 não vai bem para Jin-a. Jun-hui volta à Coreia depois de três anos no exterior.","air_date":"2018-03-30","runtime":81,"still_path":"https://image.tmdb.org/t/p/original/n16qRLydC7JnnLNJIa9hSnYVLBh.jpg","vote_average":0},"2":{"name":"Episódio 2","overview":"Uma colega de trabalho de Jin-a se interessa por Jun-hui. A mãe de Jin-a começa a se preocupar pela filha não pensar em casamento.","air_date":"2018-03-31","runtime":71,"still_path":"https://image.tmdb.org/t/p/original/nXL2sVTIfIiiJ3L8dCD4POuD7Ck.jpg","vote_average":0},"3":{"name":"Episódio 3","overview":"Gyu-min conta para todo mundo que Jin-a gosta de Jun-hui, mas ninguém acredita. Jun-hui acha que Jin-a quer voltar para Gyu-min.","air_date":"2018-04-06","runtime":84,"still_path":"https://image.tmdb.org/t/p/original/z1zjTp74RyrnyxiywHMvPFjCkf3.jpg","vote_average":0},"4":{"name":"Episódio 4","overview":"Embora apaixonada, Jin-a ainda tem dúvidas sobre o relacionamento, e se oferece para partir em uma viagem de negócios que ninguém mais quer fazer.","air_date":"2018-04-07","runtime":80,"still_path":"https://image.tmdb.org/t/p/original/auoD9Xp1wncF2n9nyQABAffRMgP.jpg","vote_average":0},"5":{"name":"Episódio 5","overview":"Jin-a deixa a culpa de lado e passa a noite na casa de Jun-hui. De volta ao escritório após sua viagem de negócios, ela é chamada à sala do diretor Nam.","air_date":"2018-04-13","runtime":70,"still_path":"https://image.tmdb.org/t/p/original/rxfItAumjK1GEDoHUHjBmqLhiDz.jpg","vote_average":0},"6":{"name":"Episódio 6","overview":"Jun-hui começa a se frustrar por manter seu relacionamento em segredo. O presidente Jo pede às funcionárias que apresentem suas reivindicações.","air_date":"2018-04-14","runtime":65,"still_path":"https://image.tmdb.org/t/p/original/ggN4oIdtnH0wHQUpUWxZRZ3pMBE.jpg","vote_average":0},"7":{"name":"Episódio 7","overview":"Seung-ho está com raiva de Jun-hui. Jin-a enfrenta problemas ao tentar substituir seu smartphone danificado, pois a conta está no nome de Gyu-min.","air_date":"2018-04-20","runtime":69,"still_path":"https://image.tmdb.org/t/p/original/byDxFXMQEtODHXsfUhgFKkXS0Tb.jpg","vote_average":0},"8":{"name":"Episódio 8","overview":"Jun-hui entra em pânico quando ninguém parece saber onde Jin-a está. Preocupado com a segurança dela, ele tenta contatar Gyu-min.","air_date":"2018-04-21","runtime":71,"still_path":"https://image.tmdb.org/t/p/original/jjJiAPYAQVPJUPfxZLhUNG6Tr9s.jpg","vote_average":0},"9":{"name":"Episódio 9","overview":"Recusando a ajuda de seu pai e de Jun-hui, Jin-a planeja dar ela mesma a notícia a sua mãe e Gyeong-seon. Só que as coisas não saem tão bem quanto ela esperava.","air_date":"2018-04-27","runtime":63,"still_path":"https://image.tmdb.org/t/p/original/dW52UNmNImdxI3g1VKQXcpw42C2.jpg","vote_average":0},"10":{"name":"Episódio 10","overview":"Como previsto, a mãe de Jin-a teve uma reação exagerada ao saber da notícia e acabou descontando sua raiva em todos.","air_date":"2018-04-28","runtime":68,"still_path":"https://image.tmdb.org/t/p/original/r0D1HzZdmqBltX9tpADJ9YTv2nJ.jpg","vote_average":0},"11":{"name":"Episódio 11","overview":"Jun-hui está mais preocupado com os sentimentos de Jin-a do que com os seus. Ele se recusa a desistir do relacionamento, apesar das palavras dolorosas da mãe dela.","air_date":"2018-05-04","runtime":68,"still_path":"https://image.tmdb.org/t/p/original/qFMzk01qwzSnSVWCvUXpX3HNiVA.jpg","vote_average":0},"12":{"name":"Episódio 12","overview":"Com Gyeong-seon e o pai de Jun-hui por perto, Jin-a não consegue se concentrar no encontro arranjado com outro rapaz. Este percebe o que acontece e fica incomodado.","air_date":"2018-05-05","runtime":71,"still_path":"https://image.tmdb.org/t/p/original/lPmKrWaDTV8SmefIVeHc7dD9THr.jpg","vote_average":0},"13":{"name":"Episódio 13","overview":"Furioso, Jun-hui corta a comunicação com Jin-a completamente, o que a deixa preocupada. O pai de Jun-hui liga para o pai de Jin-a e marca um encontro.","air_date":"2018-05-11","runtime":67,"still_path":"https://image.tmdb.org/t/p/original/on4VmGCasvrFCKsjGvSWXGkLNqY.jpg","vote_average":0},"14":{"name":"Episódio 14","overview":"Depois de seu anúncio chocante, Jin-a faz uma visita surpresa a Jun-hui. A mãe de Jin-a diz que ela tem que sair de casa.","air_date":"2018-05-12","runtime":80,"still_path":"https://image.tmdb.org/t/p/original/iMNz3ao0tzXTFtsjPaD5RoH0xuq.jpg","vote_average":0},"15":{"name":"Episódio 15","overview":"Jin-a tenta esconder de Jun-hui que sua mãe a expulsou de casa. Enquanto isso, na empresa de Jin-a, a intriga corre solta pelas costas dela.","air_date":"2018-05-18","runtime":82,"still_path":"https://image.tmdb.org/t/p/original/cfwwY2aaewlLoSLEyQmHMMxw6iw.jpg","vote_average":0},"16":{"name":"Episódio 16","overview":"Lembranças do passado feliz voltam à tona quando Jin-a e Jun-hui se veem pela primeira vez em meses. Mas isso só aumenta a dor deles.","air_date":"2018-05-19","runtime":87,"still_path":"https://image.tmdb.org/t/p/original/tqbF1jCU07hWfGNxl4RpldzkdEc.jpg","vote_average":10}}}}},
